class Solution(object):
    def minWindow(self, s1, s2):
        """
        res = s1[i:j]
        1) find subsequence from i, return the end_idx of s2 #from function find_end
        2) once end_idx find, return end_idx, else return None
        3) start from i + 1 and repeat 1) - 3) 
              012345678
        s1 = "abcdebdde"
                  i
        s2 = "bde"
                j
        not same, i+1, same, both + 1
        1) round1 : (i= 1, find the end)i = 1, end = 4 ans = s2[1:4+1]
        2) round 2: i = 2, find the end

        """
        i,j = 0,0
        if s1 == s2:
            return s1
        """
        s1 = "abcbdebdde"
                 i
        s2 = "bde"
                j
        """
        
        def improve_start_point(i):
            j = len(s2) - 1
            while i >=0 and j >=0:
                if s1[i] == s2[j]:
                    j -=1
                i -=1
            return i + 1 

        def find_end(i,j):
            while i < len(s1) and j < len(s2):
                if s1[i] == s2[j]:
                    i +=1 
                    j += 1
                else:
                    i += 1
            return i - 1 if j == len(s2)  else None

        ans = ""
        min_window = float('inf')
        while i < len(s1):
            end_idx = find_end(i ,0)
            if not end_idx:
                break
            start = improve_start_point(end_idx)
            if end_idx - start  < min_window:
                min_window = end_idx - start
                ans = s1[start: end_idx+1]
                
            i = start + 1
        return ans
